    <div className='p-2'>

      <h2 className='text-center text-4xl text-blue-900 border-b-2'>Services</h2>

      <div className='container lg:flex justify-around p-2 w-screen'>
        <img className='lg:w-96 rounded-full' src={springs} alt=''></img>
        <h2 className='text-center text'>Springs</h2>
        <p className='text-center mt-4'>information</p>
      </div>

      <div className='container lg:flex justify-around p-2 w-screen'>
        <img className='lg:w-96 rounded-full' src={motor} alt=''></img>
        <p className='text-center mt-4'>information</p>
      </div>

    </div>
  );
};


export default Services;
